import React from "react";
import alunos from "../../data/alunos";
export default props => {

    console.log(alunos);
    const li =
        (
            <li>
                {alunos[0].id}){alunos[0].nome} -> {alunos[0].nota}
            </li>
        );

        const lis = alunos.map(aluno=>{
            return  (
                <li>
                    {aluno.id}){aluno.nome} -> {aluno.nota}
                </li>
            );
        })

    return (
        <div>
            <ul>
               {lis}
            </ul>
        </div>
    )
}
